webpackJsonp([66362562451934],{8229:function(e,t){e.exports={data:{post:{html:"<p>Thanks to everyone who sent condolences for my father, be it on PapaScott, Facebook, Twitter or even with written words on paper. I debated posting publically about my feelings, and now I'm glad I did.</p>\n<p>I'm currently \"between the continents\", so to speak. I returned yesterday from the US, and fly today to Dubrovnik for 4 days on business. I still have some thoughts on the past week, the funeral, the Midwestern traditions, and the hotdish. I'll share them once I get the chance.</p>",fields:{title:"Thank you to everyone for everything",date:"11 Oct 2014",url:"https://papascott.de/2014-10-11-thank-you-to-everyone-for-everything/"}}},pathContext:{slug:"/2014-10-11-thank-you-to-everyone-for-everything/",prev:{fields:{title:"Absence",date:"04 Oct 2014",slug:"/2014-10-04-absence/"}},next:{fields:{title:"Where Were You?",date:"09 Nov 2014",slug:"/2014-11-09-where-were-you/"}}}}}});
